import styled from "styled-components";

export const TechStackSubUpper = styled.div`
color:black;
justify-self:center;
align-self:center;
font-size:30px;
font-weight:bold;

`

export const TechStackSec = styled.div`
display:grid;
grid-template-rows:1fr 1fr;
row-gap:40px;
@media screen and (max-width: 768px) {
grid-template-rows:0.2fr 1fr;

}


`

export const TeckStackMain = styled.div`

color: #fff;
display:block; 
position:relative; 

height:300px;
@media screen and (max-width: 768px) {
    padding:0;
    height:auto;
    
}
`

export const TeckStackSub = styled.div`

display:grid;


grid-template-columns:0.6fr 0.6fr 0.6fr 0.6fr 0.6fr 0.6fr;
@media only screen and (max-width:768px){
grid-template-columns:1fr;
grid-template-rows:0.8fr 0.6fr 0.6fr 0.6fr 0.6fr;
justify-self:center;
align-self:center;
}
`



